import React from 'react';
import './AboutUs.css';

const Team = () => {
  const teamMembers = [
    {
      id: 1,
      name: 'Imashi Thakshila',
      imgSrc: 'Imashi.jpg',
      position: 'Software Engineer',
      bio: 'Imashi Thakshila is a passionate software engineer with expertise in modern web development technologies.',
    },
    {
      id: 2,
      name: 'Tharushi Dilisha',
      imgSrc: 'Tharushi.jpg',
      position: 'Software Engineer',
      bio: 'Tharushi Dilisha is a dedicated software engineer with a strong background in building scalable applications.',
    },
    {
      id: 3,
      name: 'Akash Perera',
      imgSrc: 'Akash.jpg',
      position: 'Software Engineer',
      bio: 'Akash Perera is a detail-oriented software engineer with a deep understanding of algorithms and data structures.',
    },
    {
      id: 4,
      name: 'Harini Tharupa',
      imgSrc: 'Tharupa.jpg',
      position: 'Software Engineer',
      bio: 'Harini Tharupa is a creative software engineer who enjoys solving complex problems and learning new technologies.',
    },
    {
      id: 5,
      name: 'Nipuni Pathirana',
      imgSrc: 'Nipuni.jpg',
      position: 'Software Engineer',
      bio: 'Nipuni Pathirana is a hardworking software engineer who is always eager to improve her skills and contribute to the success of her team.',
    },
    // Add more team members here
  ];


  return (
    <div className="team">
      <h2>Meet Our Team</h2>
      <div className="team-members">
        {teamMembers.map((member) => (
          <div key={member.id} className="team-member">
            <img style={{ width: '150px', height: '180px' }} src={member.imgSrc} alt={member.name} />
            <h3>{member.name}</h3>
            <p>{member.position}</p>
            <p>{member.bio}</p>
          </div>
        ))}
      </div>
    </div>
  );
};


export default Team
